import React, { Component } from 'react'

import Pagination from '../../CommonComponents/BasicComponents/PaginationV1/Pagination'

import MyTable from '../BasicComponents/PopupTable/MyTable'
import SearchBox from '../BasicComponents/SearchBox/SearchBox'
import DropDown from '../BasicComponents/DropDown/DropDown'
import { Headers } from './TableProps'
import { Data } from './DefaultProps'
import './TrainingData.css'
import SearchBar from '../BasicComponents/SearchComponent/SearchBar'

class TrainingData extends Component {
    constructor(props) {
        super(props)
        this.state = {
            header: [],
            data: [],
            perPage: 5,
            totalPage: 0,
            currentPage: 1,
            dataPerPage: [],
            dropDownViewList: [
                { label: 'Columns to view', value: 'col' },
                { label: 'Rows to view', value: 'row' },
            ],
            dropDownViewValue: null,
            dropDownFilterList: [],
            dropDownFilterValue: null,
            searchValue: '',
            filterData: [],
            typingTimeOut: 0,
        }
    }

    componentDidMount() {
        let dropDownList = []
        for (let i = 0; i < Headers.length; i++) {
            const { DisplayName, Key, ...item } = { ...Headers[i] }
            dropDownList.push({ label: DisplayName, value: Key })
        }
        this.setState({
            header: Headers,
            data: Data,
            totalPage: Math.ceil(Data.length / this.state.perPage),
            dataPerPage: Data.slice(0, this.state.perPage),
            dropDownViewValue: this.state.dropDownViewList[0],
            dropDownFilterList: dropDownList,
            dropDownFilterValue: dropDownList[0],
        })
    }

    componentDidUpdate(prevProps, prevState, snapshot) {
        // this.setState({
        //     totalPage: Math.ceil(this.state.data.length / this.state.perPage),
        // })
    }

    handleDropDownViewChange = (value) => {
        this.setState({ dropDownViewValue: value })
    }

    handleDropDownFilterChange = (value) => {
        this.setState({ dropDownFilterValue: value })
    }

    handlePageChange = (pageNumber) => {
        this.setState({
            currentPage: pageNumber,
            dataPerPage: this.state.data.slice(
                pageNumber * this.state.perPage - this.state.perPage,
                pageNumber * this.state.perPage
            ),
            totalPage: Math.ceil(this.state.data.length / this.state.perPage),
        })
    }

    handleSearch = (event) => {
        const searchTerm = event.target.value.toLowerCase()

        if (this.state.typingTimeOut) {
            clearTimeout(this.state.typingTimeOut)
        }

        this.setState({
            searchValue: event.target.value,
            // typingTimeOut: setTimeout(() => {
            //     const filterData = this.state.data.filter(
            //         (item) =>
            //             // item.id.PatentId.toLowerCase().includes(searchTerm) ||
            //             item.title.toLowerCase().includes(searchTerm) ||
            //             item.abstract.toLowerCase().includes(searchTerm)
            //         // ||
            //         // item.class.Name.toLowerCase().includes(searchTerm)
            //     )
            //     if (searchTerm !== '') this.setState({ data: filterData })
            //     else {
            //         this.setState({ data: Headers })
            //     }
            // }, 1000),
        })

        console.log('update data')
        // this.handlePageChange(1)
    }

    render() {
        const {
            header,
            data,
            perPage,
            currentPage,
            totalPage,
            dataPerPage,
            dropDownViewList,
            dropDownViewValue,
            dropDownFilterList,
            dropDownFilterValue,
            searchValue,
        } = this.state

        return (
            <div className="container">
                <div className="header-container">
                    <span>
                        Assignee: <span className="special-text">AnyGen</span>
                    </span>
                    <div style={{ display: 'flex', alignItems: 'center' }}>
                        <span className="mr8">
                            Total patents:{' '}
                            <span className="special-text">{data.length}</span>
                        </span>
                        {/*<div className="mr8">*/}
                        {/*    <SearchBox*/}
                        {/*        width="200px"*/}
                        {/*        value={searchValue}*/}
                        {/*        onSearch={this.handleSearch}*/}
                        {/*    />*/}
                        {/*</div>*/}
                        {/*<DropDown*/}
                        {/*    className="drop-down mr8"*/}
                        {/*    onChange={this.handleDropDownViewChange}*/}
                        {/*    list={dropDownViewList}*/}
                        {/*    value={dropDownViewValue}*/}
                        {/*/>*/}
                        {/*<DropDown*/}
                        {/*    className="drop-down"*/}
                        {/*    icon="sort_down1"*/}
                        {/*    iconColor="black"*/}
                        {/*    onChange={this.handleDropDownFilterChange}*/}
                        {/*    list={dropDownFilterList}*/}
                        {/*    value={dropDownFilterValue}*/}
                        {/*/>*/}
                        <SearchBar
                            searchBarType={'type based search'}
                            onSearch={this.handleSearch}
                            sort={true}
                            sortType={'type based sort'}
                            sortOptionList={[
                                {
                                    Name: 'Patent ID',
                                },
                                {
                                    Name: 'Patent ID',
                                },
                                {
                                    Name: 'Patent ID',
                                },
                                {
                                    Name: 'Patent ID',
                                },
                            ]}
                        />
                    </div>
                </div>
                <div className="table-container">
                    <MyTable
                        Headers={header}
                        Data={dataPerPage}
                        autoHeight={true}
                        cellHeight="100%"
                        noShadow={true}
                    />
                    <br />
                    <Pagination
                        paginationType={'both'}
                        noOfPages={totalPage}
                        onChangePage={this.handlePageChange}
                        currentPage={currentPage}
                        pageItemsLimit={perPage}
                    />
                </div>
            </div>
        )
    }
}

export default TrainingData
